import s from './SideBar.module.css'
const SideBar = ()=>{
    return (
        <div className={s.SideBar}><p>Friends</p>
        <div>Sasha</div>
    <div>Denis</div>
    <div>Yulia</div>
</div>
    )
}
    export default SideBar
